import React from 'react';

import Box from '@mui/material/Box';
import Divider from "@mui/material/Divider";
import NavigateNextIcon from '@mui/icons-material/NavigateNext';
import AccountCircleOutlinedIcon from '@mui/icons-material/AccountCircleOutlined';
import AodOutlinedIcon from '@mui/icons-material/AodOutlined';
import ArticleOutlinedIcon from '@mui/icons-material/ArticleOutlined';
import InfoOutlinedIcon from '@mui/icons-material/InfoOutlined';


export default function Setting() {
    
    return (
        <div className='setting-settings-list-wrap' >
            <div>
                <AccountCircleOutlinedIcon fontSize="medium" sx={{ color:"black"}} />
                
                <p>계정</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }} />
            </div>
            <Divider />
            
            <div>
                <AodOutlinedIcon fontSize="medium"  sx={{ color:"black" }} />

                <p>화면</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }}  />
            </div>
            <Divider />

            <div>
                
                <ArticleOutlinedIcon fontSize="medium" sx={{ color:"black"}} />
                <p>공지사항</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }}  />
            </div>
            <Divider />

            <div>
                
                <InfoOutlinedIcon fontSize="medium" sx={{ color:"black"}} />
                <p>정보</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }}  />
            </div>

        </div>
    )

}
